import React from 'react';

import Header from './Header';

function App() {
  let count = 0

  function aumenta() {
    count += 1;
  }

  return (
    <div>
      <Header>Contador: {count}</Header>
      <button onClick={aumenta}>+1</button>
    </div>
  );
}

export default App;
